/* css Var */
:root {
  --primary: #25CCF7;
  --body-background:#f2f2f2;
  --white: #FFFFFF;
  --overlay-bg: rgba(255,255,255,.89);
  --dark-text:#5B5D6E;
}

/* Scss Var */
body {
  background-color: var(--body-background);
  font-family: "Exo 2", sans-serif;
}

ul {
  list-style: none;
  padding: 0;
  margin: 0;
}

a {
  text-decoration: none;
  color: inherit;
}

button {
  border: none;
  background: transparent;
  color: inherit;
  font-weight: inherit;
}
button:focus {
  outline: none;
}
button:hover {
  cursor: pointer;
}

.sr-only {
  position: absolute;
  width: 1px;
  height: 1px;
  padding: 0;
  overflow: hidden;
  clip: rect(0, 0, 0, 0);
  white-space: nowrap;
  border: 0;
}

header {
  padding-top: 40px;
  padding-bottom: 20px;
  color: var(--dark-text);
  letter-spacing: 0.03em;
  /*T0 D0*/
}
header .site-logo {
  font-size: 1.2rem;
  font-weight: 900;
}
header .site-logo__brand {
  color: var(--primary);
}
header .site-menu {
  padding-left: 40px;
}
header .site-menu li {
  font-size: 15px;
  font-size: 0.9375rem;
  font-weight: 600;
}
header .site-menu li:not(:last-of-type) {
  padding-right: 25px;
}
@media (min-width: 768px) {
  header .site-menu li button {
    position: relative;
  }
  header .site-menu li button:after, header .site-menu li button:before {
    content: "";
    display: block;
    width: 0;
    height: 2px;
    position: absolute;
    bottom: -7px;
    border-radius: 3px;
    background-color: var(--primary);
    transition: width 0.3s;
  }
  header .site-menu li button:after {
    right: 49.3%;
  }
  header .site-menu li button:before {
    left: 49.3%;
  }
  header .site-menu li:hover button:before, header .site-menu li:hover button:after, header .site-menu li.active button:before, header .site-menu li.active button:after {
    width: 50%;
  }
}
header .site-menu li.active button {
  cursor: default;
  pointer-events: none;
}
header .site-menu-btn-menu {
  margin-top: 2px;
}
header .site-menu-btn-menu:hover {
  cursor: pointer;
}
header .site-menu-btn-menu span {
  margin-top: 4px;
  margin-bottom: 4px;
}
header .site-menu-btn-menu::before, header .site-menu-btn-menu::after {
  content: "";
}
header .site-menu-btn-menu span, header .site-menu-btn-menu::before, header .site-menu-btn-menu::after {
  width: 25px;
  display: block;
  height: 3px;
  border-radius: 5px;
  transition: all 0.3s;
  background-color: var(--primary);
}
@media (max-width: 767px) {
  header {
    height: 82px;
  }
  header .site-menu ul {
    margin-top: 50px;
  }
  header .site-menu ul li:not(:first-of-type) {
    margin-top: 15px;
  }
  header .site-menu ul li.active {
    color: var(--primary);
  }
  header .site-menu.active-menu ul {
    position: absolute;
    left: 0;
    right: 0;
    bottom: 0;
    top: 0;
    height: 100%;
    width: 100%;
    background: var(--overlay-bg);
    padding-top: 93px;
    margin-top: 82px;
  }
  header .site-menu.active-menu ul li {
    animation: animations 1s;
  }
  @keyframes animations {
    0% {
      opacity: 0;
    }
    100% {
      opacity: 1;
    }
  }
  header .site-menu.active-menu .site-menu-btn-menu span {
    opacity: 0;
  }
  header .site-menu.active-menu .site-menu-btn-menu::before {
    transform: rotate(-405deg) translateY(2px) translateX(-5px);
  }
  header .site-menu.active-menu .site-menu-btn-menu::after {
    transform: rotate(405deg) translateY(-5px) translateX(-8px);
  }
}

.lock-screen {
  background-color: var(--overlay-bg);
  overflow: hidden;
}

