sources.global-style/grid/utilities/_spacing.scs:
// stylelint-disable declaration-no-important

// Margin and Padding

@each $breakpoint in map-keys($grid-breakpoints) {
  @include media-breakpoint-up($breakpoint) {
    $infix: breakpoint-infix($breakpoint, $grid-breakpoints);

    @each $prop, $abbrev in (margin: m, padding: p) {
      @each $size, $length in $spacers {
        .#{$abbrev}#{$infix}-#{$size} { #{$prop}: $length !important; }
        .#{$abbrev}t#{$infix}-#{$size},
        .#{$abbrev}y#{$infix}-#{$size} {
          #{$prop}-top: $length !important;
        }
        .#{$abbrev}r#{$infix}-#{$size},
        .#{$abbrev}x#{$infix}-#{$size} {
          #{$prop}-right: $length !important;
        }
        .#{$abbrev}b#{$infix}-#{$size},
        .#{$abbrev}y#{$infix}-#{$size} {
          #{$prop}-bottom: $length !important;
        }
        .#{$abbrev}l#{$infix}-#{$size},
        .#{$abbrev}x#{$infix}-#{$size} {
          #{$prop}-left: $length !important;
        }
      }
    }

    // Negative margins (e.g., where `.mb-n1` is negative version of `.mb-1`)
    @each $size, $length in $spacers {
      @if $size != 0 {
        .m#{$infix}-n#{$size} { margin: -$length !important; }
        .mt#{$infix}-n#{$size},
        .my#{$infix}-n#{$size} {
          margin-top: -$length !important;
        }
        .mr#{$infix}-n#{$size},
        .mx#{$infix}-n#{$size} {
          margin-right: -$length !important;
        }
        .mb#{$infix}-n#{$size},
        .my#{$infix}-n#{$size} {
          margin-bottom: -$length !important;
        }
        .ml#{$infix}-n#{$size},
        .mx#{$infix}-n#{$size} {
          margin-left: -$length !important;
        }
      }
    }

    // Some special margin utils
    .m#{$infix}-auto { margin: auto !important; }
    .mt#{$infix}-auto,
    .my#{$infix}-auto {
      margin-top: auto !important;
    }
    .mr#{$infix}-auto,
    .mx#{$infix}-auto {
      margin-right: auto !important;
    }
    .mb#{$infix}-auto,
    .my#{$infix}-auto {
      margin-bottom: auto !important;
    }
    .ml#{$infix}-auto,
    .mx#{$infix}-auto {
      margin-left: auto !important;
    }
  }
}

sources.global-style/global-style.scss:
body {
    background-color: var(--body-background);
    font-family: 'Exo 2', sans-serif;
}

ul {
    list-style: none;
    padding: 0;
    margin:0;
}

a {
    text-decoration: none;
    color : inherit;
}
button {
    border: none;
    background: transparent;
    color : inherit;
    font-weight: inherit;
    &:focus {
        outline: none;
    }
    &:hover {
        cursor: pointer;
    }
}
.sr-only {
    position: absolute;
    width: 1px;
    height: 1px;
    padding: 0;
    overflow: hidden;
    clip: rect(0,0,0,0);
    white-space: nowrap;
    border: 0
}
@mixin animations($attribute , $start-value , $end-value , $time) {
    @keyframes animations {
        0% {
            #{$attribute}: $start-value;
        }
        100% {
            #{$attribute}: $end-value;
        }
    }
    animation: animations #{$time};
}

@mixin overlay {
    position: absolute;
    left: 0;
    right: 0;
    bottom: 0;
    top: 0;
    height: 100%;
    width: 100%;
    background: var(--overlay-bg);
}

sources.component/header/header.scss:
header {
    padding-top: 40px;
    padding-bottom: 20px;
    color: var(--dark-text);
    letter-spacing: .03em;
    .site-logo {
        font-size: 1.2rem;
        font-weight: 900;
        &__brand {
            color: var(--primary);
        }
    }
    .site-menu {
        padding-left: 40px;
        li {
            @include font-size(15);
            font-weight: 600;
            &:not(:last-of-type) {
                padding-right: 25px;
            }
            @include media('>=tablet') {
                button {
                    position: relative;
                    &:after , &:before {
                        content: '';
                        display:block;
                        width:0;
                        height: 2px;
                        position: absolute;
                        bottom: -7px; 
                        border-radius: 3px;
                        background-color: var(--primary);   
                        transition:  width .3s;  
                    }
                    &:after { 
                        right : 49.3%;
                    }
                    &:before { 
                        left : 49.3%;
                    }
                }
                &:hover , &.active {
                    button {
                        &:before , &:after {
                            width: 50%;
                        }
                    }
                }
            }
            &.active {
                button {
                    cursor: default;
                    pointer-events: none;
                }
            }
        }
        &-btn-menu {
            margin-top: 2px;
            &:hover {
                cursor: pointer;
            }
            span {
                margin-top: 4px;
                margin-bottom: 4px;
            }
            &::before , &::after {
                content: '';
            }
            span , &::before , &::after {
                width: 25px;
                display: block;
                height: 3px;
                border-radius: 5px;
                transition: all .3s ;
                background-color: var(--primary);
            }
        }
    }
     /*T0 D0*/
     @include media('<tablet') {
         height: $header-height-sm;
        .site-menu {
            ul {
                margin-top: 50px;
                li {
                    &:not(:first-of-type) {
                        margin-top: 15px;
                    }
                    &.active {
                        color: var(--primary);
                    }
                }
            }

            &.active-menu {
                ul {
                    @include overlay;
                    padding-top: 93px;
                    margin-top: $header-height-sm;
                    li {
                        @include animations('opacity' , 0 , 1 , '1s');
                    }
                }
                .site-menu-btn-menu {
                    span {
                        opacity: 0;
                    }
                    &::before {
                        transform: rotate(-405deg) translateY(2px) translateX(-5px);
                    }
                    &::after {
                        transform: rotate(405deg) translateY(-5px) translateX(-8px);
                    }
                }
            }
        }
    }
}

.lock-screen {
    background-color: var(--overlay-bg);
    overflow: hidden;
}

